metadata:
  name: listmodels
  description: >-
    Lists the versions of a model in an Amazon Lookout for Vision project. The
    ListModels operation is eventually consistent. Recent calls to CreateModel
    might take a while to appear in the response from ListProjects. This
    operation requires permissions to perform the lookoutvision:ListModels
    operation.
